import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [weatherData, setWeatherData] = useState(null);

  useEffect(() => {
    const fetchWeatherData = async () => {
      try {
        const response = await axios.get('https://api.tomorrow.io/v4/weather/realtime?location=toronto&apikey=XFXyFO6PhxoNZ7Q5GW9aplmrRfeolgff');
        setWeatherData(response.data);
      } catch (error) {
        console.error('Error fetching weather data:', error);
      }
    };

    fetchWeatherData();
  }, []);

  return (
    <div>
      <h1>Real-Time Weather Data for Toronto</h1>
      {weatherData ? (
        <div>
          <p>Time: {weatherData.data.time}</p>
          <p>Temperature: {weatherData.data.values.temperature}Â°C</p>
          <p>Humidity: {weatherData.data.values.humidity}%</p>
          <p>Cloud Cover: {weatherData.data.values.cloudCover}%</p>
          {/* Add more weather data fields here */}
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default App;
